use Carbon\Carbon;

class Measurement extends Model
{
    use HasFactory;

    protected $fillable = [
        'nik',
        'tanggal_pengukuran',
        'berat_badan',
        'panjang_badan',
        'cara_pengukuran',
        'bb_u',
        'zs_bb_u',
        'tb_u',
        'zs_tb_u',
        'bb_tb',
        'zs_bb_tb',
        'lingkar_kepala',
    ];

    protected $dates = ['tanggal_pengukuran'];

    public function child()
    {
        return $this->belongsTo(Child::class, 'nik', 'nik');
    }

    public function calculateAgeInMonths($nik, $tanggal_pengukuran)
    {
        $child = new Child();
        $child = $child->where('nik', $nik)->first();

        $tanggal_lahir = Carbon::parse($child->tanggal_lahir);
        $tanggal_pengukuran = Carbon::parse($tanggal_pengukuran);

        $umurBulan = $tanggal_lahir->diffInMonths($tanggal_pengukuran);

        return $umurBulan;
    }

